Would be great if python syntax highlighting were supported in \{code\} blocks like some other languages.

{noformat}
{code:python}
def foo():
    print('hi')
{code}
{noformat}

{noformat}
Unable to find source-code formatter for language: python.
Available languages are: actionscript, html, java, javascript, none, sql, xhtml, xml
def foo():
    print('hi')
{noformat}

When the value of multi-select custom field is retrieved by using Python XML-RPC, only the first value of the selection is displayed. For example,

Source:
{noformat}
import xmlrpclib

s = xmlrpclib.ServerProxy('http://localhost:8080/rpc/xmlrpc')
auth = s.jira1.login('admin', 'admin')

print s.jira1.getIssue(auth, 'PA-1')
{noformat}

Result:
{noformat}
{'status': '1', 'project': 'PA', 'updated': '2009-04-30 21:41:39.64', 'votes': '0', 'components': [], 'reporter': 'admin', 'customFieldValues': [{'values': 'A', 'customfieldId': 'customfield_10000'}], 'created': '2009-04-30 21:41:39.64', 'fixVersions': [], 'summary': 'test', 'priority': '3', 'assignee': 'admin', 'key': 'PA-1', 'affectsVersions': [], 'type': '1', 'id': '10000'}
{noformat}

Even though the multi-select custom field value displayed in the view issue screen is A, B, C. It's just showing the 'A' value.

Would be great if the support for Python syntax highlighting is added in Crucible review comments. Currenctly when wiki markup \{code:python} is used, it displays the following message below:-

{noformat}
Unable to find source-code formatter for language: python. Available languages are: actionscript, html, java, javascript, none, sql, xhtml, xml
{noformat}

